import mongoose, { Schema } from 'mongoose';

const User = new Schema({
  twitchId: String,
  fname: String,
  displayName: String,
  email: String,
  tel: String,
  username: String,
  profileImg: String,
  provider: String,
  stats: Object,
  ign: String,
  streamer: Object,
  role: String,
  online: Boolean,
});

const model = new mongoose.model("User", User);

export default model;
